import React from 'react'
import MenuCard from './MenuCard';
import Data from './Data';
const App = () => {








  return (
   <>
      <div className="container">
        <div className="row">
          <div className="col-xs-12">
            <button class="btn btn-success">breakfask</button>
            <button class="btn btn-danger">Lunch</button>
            <button class="btn btn-danger">Dinner</button>
            <button class="btn btn-danger">All</button>
          </div>
        </div>
      </div>



      <div className="container">
        <div className="row">

        {Data.map((index,indno)=>
        {
          return(
          <MenuCard
            ind={indno}
            name={index.name}
            img={index.img}
            desc={index.description}
            price={index.price}
            serving={index.serving}
            type={index.type}

          />

          )
        })}

        </div>
      </div>

    </>  
  )
}
export default App;
